nt messages forever if your mail server has issues or you make a mistake in mail configuration.'=>'Contact Form 7 không lưu trữ các tin nhắn đã gửi ở bất cứ đâu. Do đó, bạn có thể mất vĩnh viễn các tin nhắn quan trọng nếu máy chủ thư của bạn gặp sự cố hoặc bạn mắc lỗi trong cấu hình thư.','Before you cry over spilt mail&#8230;'=>'Bạn sợ mất dữ liệu?','https://contactform7.com/comment-blacklist/'=>'https://contactform7.com/comment-blacklist/','Contact Form 7 supports spam-filtering with %1$s. Intelligent %2$s blocks annoying spambots. Plus, using %3$s, you can block messages containing specified keywords or those sent from specified IP addresses.'=>'Contact Form 7 hỗ trợ lọc mail rác với plugin %1$s. Bạn cũng có thể sử dụng plugin %2$s thông minh chặn các spambot khó ưa. Thêm vào đó, khi sử dụng %3$s, bạn có thể chặn các tin nhắn chứa các từ khoá cụ thể hoặc những thứ được gửi từ các địa chỉ IP nào đó.','Spammers target everything; your contact forms are not an exception. Before you get spammed, protect your contact forms with the powerful anti-spam features Contact Form 7 provides.'=>'Kẻ gửi thư rác nhắm mục tiêu vào mọi thứ; biểu mẫu liên hệ của bạn cũng không ngoại lệ. Trước khi bạn bị spam, hãy bảo vệ biểu mẫu liên hệ của bạn bằng các tính năng chống spam mạnh mẽ mà Contact Form 7 cung cấp.','Getting spammed? You have protection.'=>'Bị spam? Hãy yên tâm, bạn sẽ được bảo vệ.','Multiple form controls are in a single label element.'=>'Nhiều mục đang nằm trong cùng một nhãn.','FAQ about Configuration Validator'=>'Câu hỏi thường gặp về Xác thực Cấu hình','https://contactform7.com/configuration-validator-faq/'=>'https://contactform7.com/configuration-validator-faq/','The answer to the quiz is incorrect.'=>'Câu trả lời chưa đúng.','There was an error uploading the file.'=>'Tải file lên không thành công.','You are not allowed to upload files of this type.'=>'Bạn không được phép tải lên file theo định dạng này.','There was an unknown error uploading the file.'=>'Tải file 