le Attachments field on the Mail tab.'=>'Để đính kèm file qua mục nhập vào email, bạn cần chèn mail tag %s vào trong mục File đính kèm trong tab Cấu hình Mail.','Acceptable file types'=>'Các định dạng file được chấp nhận','File size limit (bytes)'=>'Kích thước file (theo byte)','File uploading and attachment'=>'Tải lên và đính kèm tệp','https://contactform7.com/file-uploading-and-attachment/'=>'https://contactform7.com/file-uploading-and-attachment/','Generate a form-tag for a file uploading field. For more details, see %s.'=>'Khởi tạo mục nhập cho tải file lên. Để biết thêm, xem %s.','file'=>'file','Uploading a file fails for PHP error'=>'Tải file lên gặp lỗi PHP','Uploaded file is too large'=>'Kích thước file tải lên quá lớn','Uploaded file is not allowed for file type'=>'File được tải lên không phải loại file được chấp nhận.','Uploading a file fails for any reason'=>'Lỗi không xác định được khi tải file lên.','Max'=>'Tối đa','Min'=>'Tối thiểu','Range'=>'Phạm vi','Use this text as the placeholder of the field'=>'Sử dụng dòng này làm chữ chìm trong mẫu nhập (placeholder)','Default value'=>'Giá trị mặc định','Date field'=>'Trường ngày tháng','https://contactform7.com/date-field/'=>'https://contactform7.com/date-field/','Generate a form-tag for a date input field. For more details, see %s.'=>'Tạo ra một thẻ mẫu cho một mục nhập cho các giá trị ngày tháng. Để biết thêm chi tiết, xem %s.','date'=>'ngày','Date is later than maximum limit'=>'Ngày trễ hơn khoảng thời gian giới hạn','Date is earlier than minimum limit'=>'Ngày sớm hơn khoảng thời gian giới hạn','Date format that the sender entered is invalid'=>'Định dạng ngày tháng không hợp lệ','To use the value input through this field in a mail field, you need to insert the corresponding mail-tag (%s) into the field on the Mail tab.'=>'Để  giá trị được nhập xuất hiện trong email gửi đến, bạn cần chèn mail tag %s vào Nội dung email trong Cấu hình Email.','Make checkboxes exclusive'=>'Là checkbox duy nhất trong toàn bộ form','Wrap each item with label element'=>'Bọc mỗi mục với nhãn của nó','Put a label first, a checkbox last'=>'Đặt nhãn trước, checkbox sau','One option per line.'=>'Mỗi dòng là một lựa chọn.','Required field'=>'Mục bắt buộc','Field type'=>'Kiểu','Checkboxes, radio buttons and menus'=>'Ô chọn, nút radio và menu','https://contactform7.com/checkboxes-radio-buttons-and-menus/'=>'https://contactform7.com/checkboxes-radio-buttons-and-menus/','Generate a form-tag for a group of radio buttons. For more details, see %s.'=>'Khởi tạo tuỳ chọn dạng radio. Để biết thêm, xem %s.','Generate a form-tag for a group of checkboxes. For more details, see %s.'=>'Khởi tạo mục nhập tuỳ chọn checkbox. Để biết thêm, xem %s.','radio buttons'=>'tuỳ chọn radio','checkboxes'=>'tuỳ chọn checkbox','This contact form contains CAPTCHA fields, but the necessary libraries (GD and FreeType) are not available on your server.'=>'Biểu mẫu này có sử dụng ô CAPTCHA, song các thư viện cần thiết như GD và FreeType không được cài đặt trên máy chủ của bạn.','This contact form contains CAPTCHA fields, but the temporary folder for the files (%s) does not exist or is not writable. You can create the folder or change its permission manually.'=>'Biểu mẫu này có sử dụng ô CAPTCHA, song thư mục lưu file (%s) không tồn tại hoặc không thể ghi lên được. Bạn cần tự tạo folder đó hoặc thay đổi quyền hạn của nó.','Input field settings'=>'Cấu hình cho ô trống','Image settings'=>'Cấu hình cho ảnh','https://contactform7.com/captcha/'=>'https://contactform7.com/captcha/','Generate form-tags for a CAPTCHA image and corresponding response input field. For more details, see %s.'=>'Khởi tạo cho ảnh CAPTCHA và kiểm tra thông tin các mục nhập. Để biết thêm, xem %s.','To use CAPTCHA, you first need to install and activate %s plugin.'=>'Để sử dụng CAPTCHA, bạn đầu tiên phải cài đặt và kích hoạt plugin %s.','CAPTCHA'=>'CAPTCHA','Your entered code is incorrect.'=>'Bạn đã nhập sai mã CAPTCHA.','The code that sender entered does not match the CAPTCHA'=>'Mã người gửi nhập không khớp với CAPTCHA','Insert Tag'=>'Chèn vào Form','Class attribute'=>'Thuộc tính Class','Id attribute'=>'Thuộc tính ID','Options'=>'Các tuỳ chọn','Name'=>'Tên','Acceptance checkbox'=>'Ô chọn chấp nhận','https://contactform7.com/acceptance-checkbox/'=>'https://contactform7.com/acceptance-checkbox/','Generate a form-tag for an acceptance checkbox. For more details, see %s.'=>'Tạo mục nhập để người dùng chấp nhận điều khoản. Xem chi tiết tại %s','acceptance'=>'điều khoản chấp nhận','<code>%1$s</code> property of a <code>WPCF7_ContactForm</code> object is <strong>no longer accessible</strong>. Use <code>%2$s</code> method instead.'=>'Thuộc tính <code>%1$s</code> của một <code>WPCF7_ContactForm</code> object <strong>không thể truy cập vào nữa</strong>. Thay vào đó hãy sử dụng phương án  <code>%2$s</code>.','Untitled'=>'Chưa có tiêu đề','Contact Form'=>'Form liên hệ','There is a field with input that is shorter than the minimum allowed length'=>'Có mục nhập ngắn hơn số kí tự tối thiểu','There is a field with input that is longer than the maximum allowed length'=>'Có mục nào đó nhập dài hơn số kí tự cho phép','There is a field that the sender must fill in'=>'Có mục bắt buộc người dùng phải nhập','There are terms that the sender must accept'=>'Có điều khoản bắt buộc người sử dụng phải xác nhận đồng ý','Submission was referred to as spam'=>'Nội dung gửi đến được xác định giống spam','Validation errors occurred'=>'Dữ liệu nhập vào không hợp lệ','Sender\'s message failed to send'=>'Có lỗi xảy ra và không thể gửi form đi','Sender\'s message was sent successfully'=>'Form được gửi đi thành công','Message Body:'=>'Nội dung thông điệp:','Subject: %s'=>'Tiêu đề: %s','From: %s'=>'Gửi đến từ: %s','Send'=>'Gửi đi','Your message'=>'Tin nhắn của bạn','Your email'=>'Email của bạn','Your name'=>'Tên của bạn','Form-tag Generator: %s'=>'Khởi tạo mục nhập mới: %s','For more information:'=>'Để thêm thông tin:','Any information you provide will not be shared with service providers without your authorization.'=>'Bất kỳ thông tin bạn cung cấp sẽ không được chia sẻ với nhà cung cấp dịch vụ nếu thiếu sự uỷ quyền của bạn.','You may need to first sign up for an account with the service that you plan to use. When you do so, you would need to authorize Contact Form 7 to access the service with your account.'=>'Bạn có thể cần tạo tài khoản để sử dụng gói dịch vụ. Nếu đúng, hãy xác thực với Contact Form 7 để truy cập dịch vụ kèm theo tài khoản cua bạn.','On this screen, you can manage services that are available through Contact Form 7. Using API will allow you to collaborate with any services that are available.'=>'Trong màn hình hiện tại, bạn có thể quản lý các dịch vụ có sẵn thông qua plugin Contact Form 7. Sử dụng API sẽ cho phép bạn tương tác với các bất kỳ dịch vụ nào khả dụng.','There are also special mail-tags that have specific names, but do not have corresponding form-tags. They are used to represent meta information of form submissions like the submitter&#8217;s IP address or the URL of the page.'=>'Ngoài ra còn có các thẻ thư đặc biệt có tên cụ thể nhưng không có thẻ biểu mẫu tương ứng. Chúng được sử dụng để thể hiện thông tin meta của việc gửi biểu mẫu như địa chỉ IP của người gửi hoặc URL của trang.','A mail-tag is also a short code enclosed in square brackets that you can use in every Mail and Mail (2) field. A mail-tag represents a user input value through an input field of a corresponding form-tag.'=>'Tag Mail là các đoạn mã ngắn trong cặp dấu ngoặc vuông được sử dụng trong tab Cấu hình Mail. Tag mail thực ra là các giá trị mà người dùng nhập vào khi gửi form như địa chỉ, họ và tên, số điện thoại.','While form-tags have a comparatively complex syntax, you do not need to know the syntax to add form-tags because you can use the straightforward tag generator (<strong>Generate Tag</strong> button on this screen).'=>'Mặc dù các thẻ biểu mẫu có cú pháp tương đối phức tạp, bạn không cần phải biết cú pháp để thêm thẻ biểu mẫu vì bạn có thể sử dụng trình tạo thẻ đơn giản (nút <strong>Tạo thẻ</strong> trên màn hình này).','A form-tag is a short code enclosed in square brackets used in a form content. A form-tag generally represents an input field, and its components can be separated into four parts: type, name, options, and values. Contact Form 7 supports several types of form-tags including text fields, number fields, date fields, checkboxes, radio buttons, menus, file-uploading fields, CAPTCHAs, and quiz fields.'=>'Tag Form là các shortcode ngắn nằm trong cặp dấu vuông, ví dụ [ten-cua-ban]. Nó đại diện cho các mục nhập ngoài website, và thường chứa các thành phần: loại, tên, các tuỳ chọn và giá trị. Contact Form 7 cung cấp một vài loại nhập phổ biến như văn bản, số, ngày tháng, tuỳ chọn checkbox, tuỳ chọn radio, menu, tải file, CAPTCHA chống spam và đặt câu hỏi.','<strong>Additional Settings</strong> provides a place where you can customize the behavior of this contact form by adding code snippets.'=>'<strong>Tuỳ chọn khác</strong> cung cấp nơi bạn nhập các thiết lập bổ sung bởi các đoạn code ngắn.','In <strong>Messages</strong>, you can edit various types of messages used for this contact form. These messages are relatively short messages, like a validation error message you see when you leave a required field blank.'=>'Trong <strong>Thông báo và Chú ý</strong>, bạn có thể tuỳ biến các thông báo hiển thị tới người nhập form, chẳng hạn như mục nhập bắt buộc, nhập sai định dạng hoặc nhập quá dài số kí tự cho phép.','<strong>Mail (2)</strong> is an additional mail template that works similar to Mail. Mail (2) is different in that it is sent only when Mail has been sent successfully.'=>'<strong>Cấu hình Mail kiểu 2</strong> là một kiểu cấu hình email giống mặc định, tuy nhiên nó sẽ chỉ gửi email một khi nhận được xác nhận email từ người dùng.','<strong>Mail</strong> manages a mail template (headers and message body) that this contact form will send when users submit it. You can use Contact Form 7&#8217;s mail-tags here.'=>'<strong>Cấu hình Email</strong> quản lý giao diện mẫu của email (cả header và nội dung email) mà khi người dùng nhập nội dung và gửi đi, nó sẽ được chuyển đến email được xác định. Bạn có thể sử dụng các thẻ mail (như tên người dùng, địa chỉ email, địa chỉ liên hệ,...) ở đây. Các thẻ mail này được tạo ra khi bạn chèn thêm nội dung mục muốn người dùng nhập.','<strong>Form</strong> is a content of HTML form. You can use arbitrary HTML, which is allowed inside a form element. You can also use Contact Form 7&#8217;s form-tags here.'=>'<strong>Nội dung form</strong> chứa các nội dung định dạng HTML. Bạn có thể sử dụng các tag form khác nhau (như văn bản, email, số điện thoại,...) để chèn vào nội dung hiển thị form ở ngoài website.','<strong>Title</strong> is the title of a contact form. This title is only used for labeling a contact form, and can be edited.'=>'<strong>Tiêu đề</strong> là tên của form liên hệ. Nó được sử dụng để xác định và phân biệt các loại form bạn tạo (ví dụ form liên hệ trang chủ, form đặt hàng,..) và có thể thay đổi.','On this screen, you can edit a contact form. A contact form is comprised of the following components:'=>'Trong màn hình này, bạn có thể sửa form. Nó bao gồm các thành phần sau:','<strong>Duplicate</strong> - Clones that contact form. A cloned contact form inherits all content from the original, but has a different ID.'=>'<strong>Sao chép</strong> - Là thao tác tạo ra một bản sao khác của form. Nó sẽ chứa tất cả nội dung từ bản gốc, nhưng chỉ thay đổi ID.','<strong>Edit</strong> - Navigates to the editing screen for that contact form. You can also reach that screen by clicking on the contact form title.'=>'<strong>Sửa</strong> - Nhấp chuột vào để sửa form liên hệ.','Hovering over a row in the contact forms list will display action links that allow you to manage your contact form. You can perform the following actions:'=>'Khi rê chuột vào một dòng trong danh sách form liên hệ, bạn có thể thực hiện các thao tác quản lý form đó như:','On this screen, you can manage contact forms provided by Contact Form 7. You can manage an unlimited number of contact forms. Each contact form has a unique ID and Contact Form 7 shortcode ([contact-form-7 ...]). To insert a contact form into a post or a text widget, insert the shortcode into the target.'=>'Trong giao diện này, bạn có thể quản lý các form được tạo trong Contact Form 7. Mỗi form thường có một shortcode để bạn chèn vào nội dung trang, bài viết hay widget HTML Tuỳ chỉnh để hiển thị ngoài website.','Mail-tags'=>'Tag Mail','Form-tags'=>'Tag Form','Available Actions'=>'Hành động có sẵn','Overview'=>'Tổng quan','You can add customization code snippets here. For details, see %s.'=>'Bạn có thể tuỳ biến một số đoạn code khác ở đây. Xem chi tiết tại %s','https://contactform7.com/additional-settings/'=>'https://contactform7.com/additional-settings/','File attachments'=>'Tệp đính kèm','Use HTML content type'=>'Sử dụng mã HTML cho phần nội dung của thư','Exclude lines with blank mail-tags from output'=>'Không bao gồm các dòng chứa mail tag trống','Message body'=>'Nội dung tin nhắn','Additional headers'=>'Tiêu đề bổ sung','Subject'=>'Tiêu đề:','From'=>'Mail gửi','To'=>'Mail nhận','In the following fields, you can use these mail-tags:'=>'Trong các mục nhập dữ liệu dưới đây, bạn có thể sử dụng các thẻ dữ liệu sau:','Mail (2) is an additional mail template often used as an autoresponder.'=>'Kiểu cấu hình mail 2 thường được sử dụng như là trả lời tự động.','Use Mail (2)'=>'Bật cấu hình Mail này','Mail (2)'=>'Cấu hình Mail kiểu 2','Y/m/d'=>'d/m/Y','Edit &#8220;%s&#8221;'=>'Sửa &#8220;%s&#8221;','Edit'=>'Sửa','Date'=>'Ngày','Author'=>'Tác giả','Shortcode'=>'Shortcode','Title'=>'Tiêu đề','Additional Settings'=>'Tuỳ chọn khác','Additional Settings (%d)'=>'Các tuỳ chọn khác (%d)','Messages'=>'Thông báo và Chú ý','Mail'=>'Cấu hình Mail','Form'=>'Nội dung Form','Support'=>'Hỗ trợ','https://contactform7.com/support/'=>'https://contactform7.